% Format for each line of text:
formatSpec = '%q%[^\n\r]';
% Open the text file.
fileID = fopen(filename,'r');
% Read columns of data according to the format.
dataArray = textscan(fileID, formatSpec, 'Delimiter', delimiter,  'ReturnOnError', false);
% Close the text file.
fclose(fileID);
% Create output variable
C8ParEGOvalidation2obj = [dataArray{1:end-1}];
% Clear temporary variables
clearvars filename delimiter formatSpec fileID dataArray ans;

% make a vetcor from the second obj cell array
for i=1:length(C8ParEGOvalidation2obj)
   v28=C8ParEGOvalidation2obj{i,1}; 
   sol_dist_28(i,:)=str2num(v28);
end

% get the 90% from the distribution
for i=1:length(C8ParEGOvalidation2obj)
   dist_s28=sol_dist_28(i,:);
   robust_sol_28(i,:)=prctile(dist_s28,90);
end

% put all the robust non-dominated solutions in one variable
for i=1:length(robust_sol_18)
   C8_Y_nd(i,:)=[robust_sol_18(i) robust_sol_28(i)];
end

%Plots
figure
hold on
plot(C8_Y_nd(:,1),C8_Y_nd(:,2),'bx')


